import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const styles = {
li: {
    listStyleType: 'none',
    marginLeft: '-1vw',
    fontSize: '1.5rem',
    fontWeight: '600'
  }
}

const ListItem = props => {
  return (
      <li style={styles.li}>
        <FontAwesomeIcon icon="arrow-right" />
        &ensp; {props.children}
      </li>
  );
};

export default ListItem;
